def checkValidString(s: str) -> bool:
    left_bracket_cnt, asterisk_cnt = 0, 0
    for ch in s:
        if ch == '(':
            left_bracket_cnt += 1
        elif ch == ')':
            if left_bracket_cnt > 0: 
                left_bracket_cnt -= 1
            elif asterisk_cnt > 0:
                asterisk_cnt -= 1
            else:
                return False
        else:
            asterisk_cnt += 1

    return left_bracket_cnt <= asterisk_cnt
